import React from 'react';
import * as Icon from 'react-feather';

import styled from 'styled-components';

const Wrapper = styled.div`
width: 100%;
height: 30px;
display: flex;
align-items: center;
justify-content: space-around;
background-color: #FFFFFF;


`


const MobileTabMenu = () => {
    return (
        <Wrapper>
            <Icon.Hame />
            <Icon.Search />


        </Wrapper>
    )
}


export default MobileTabMenu;
